    "# Ask and Prepare\n",
    "\n",
    "## About Bellabeat\n",
    "Bellabeat is a high-tech manufacturer of health products for women. Bellabeat is based in San Franciso, CA and founded by Sandro Mur and Urška Sršen in 2013. Urška Sršen believes that analyzing smart device fitness data can help the company grow exponentially. Bellabeat has demonstrated great success with collecting data on fitness activity, sleep, stress, and reproductive health. \n",
    "\n",
    "## Ask\n",
    "**The Business Task**      \n",
    "Analyze smart device usage data to gain relevant insights on how consumers use smart devices.\n",
    "\n",
    "**Objectives:**       \n",
    "*\tWhat are some trends in smart device usage?\n",
    "* How could these trends apply to Bellabeat customers?\n",
    "* How could these trends help influence Bellabeat marketing strategy?\n",
    "\n",
    "## The Data\n",
    "**Credibility:**      \n",
    "The dataset was a survey distributed via Amazon Mechanical Turk (MTurk) between March 12, 2016 and May 12, 2016. MTurk is a crowdsourcing marketplace owned by Amazon that enables companies to outsource data collection resulting in a large population of consenting participants. MTurk is an efficient, reliable, and cost-effective tool for businesses.\n",
    "\n",
    "# Process\n",
    "\n",
    "## Cleaning and Viewing Data Frame\n",
    "Importing librarys"
   ]
