   "source": [
    "activitysleepleft$TotalSleep <- activitysleepleft$TotalMinutesAsleep/60 \n",
    "\n",
    "sleep_mean <- activitysleepleft %>%\n",
    "  drop_na() %>% \n",
    "  pull(TotalSleep) %>% \n",
    "  mean() %>% \n",
    "  signif(3)\n",
    "\n",
    "ggplot(data = activitysleepleft, aes(x = TotalSleep)) +\n",
    "  geom_histogram(binwidth = 1, color = \"black\", fill = \"blue\") +\n",
    "  geom_vline(xintercept=sleep_mean, size = 1.5, linetype = \"dotted\") +\n",
    "  labs(title = \"Total Time Spent Sleeping\", x = \"Hours Slept\", y = \"Total Reports\")"
   ]
  },
