   "source": [
    "sleep_users <- activitysleepleft %>% \n",
    "  group_by(ActivityDate) %>% \n",
    "  summarise(sleep_num = n_distinct(Id))\n",
    "\n",
    "sleep_users_date <- as.Date(sleep_users$ActivityDate, format = \"%m/%d/%y\")\n",
    "\n",
    "sleep_users %>% \n",
    "  ggplot(aes(y = sleep_num,x = sleep_users_date)) +\n",
    "  geom_point() +\n",
    "  geom_smooth(method = lm, se = FALSE) +\n",
    "  labs(title = \"Number of Participants Over Time\",x = \"Date\", y = \"Number of Reports\")"
   ]
  },
