   "source": [
    "activitysleepleft <- activitysleepleft %>% \n",
    "  mutate(total_activity = VeryActiveMinutes + FairlyActiveMinutes + LightlyActiveMinutes)\n",
    "\n",
    "activitysleepleft <- activitysleepleft %>% \n",
    "  mutate(total_sedentary = SedentaryMinutes - TotalTimeInBed) %>% \n",
    "  drop_na()\n",
    "\n",
    "activitysleepleft %>% \n",
    "  ggplot(aes(x= total_activity, y = TotalSleep)) +\n",
    "  geom_point() +\n",
    "  geom_smooth(method = lm) +\n",
    "  labs(title = \"Total Daily Activity vs Time Slept\", x = \"Total Daily Activity\", y = \"Total Time Slept\")"
   ]
  },
