   "source": [
    "activitysleepleft %>% \n",
    "  ggplot(aes(y = TotalSleep, x = total_sedentary))+\n",
    "  geom_point() +\n",
    "  geom_smooth(method = lm) +\n",
    "  labs(title = \"Total Sleep vs Sedentary Time\", x = \"Sedentary Time in Minutes\",y = \"Total Time Slept\")\n",
    "\n",
    "\n",
