    "calories_mean <- activitysleepleft %>%\n",
    "  drop_na() %>% \n",
    "  pull(Calories) %>% \n",
    "  mean() %>% \n",
    "  signif(3)\n",
    "\n",
    "activitysleepleft %>% \n",
    "  ggplot(aes(x = Calories, y = total_activity))+\n",
    "  geom_point() +\n",
    "  geom_smooth(method = lm) +\n",
    "  geom_vline(xintercept=calories_mean, size = 1.5, linetype = \"solid\", alpha = 0.2, color = \"red\") +\n",
    "  labs(title = \"Calories vs Total Daily Activity\", subtitle = \"Mean = 2330 Calories\", x = \"Calories\", y = \"Total Activity\")"
   ]
