   "source": [
    "# Conclusions\n",
    "Smart device data provides a lot of insight into the daily activities of users. We found that users sleep 7 hours a night on average, taking about 40 minutes to fall asleep once in bed. Users who are not active and tend to remain sedentary during the day tend to have less consistent sleep.    \n",
    "\n",
    "We saw that the number of participants significantly decreased over time.   \n",
    "\n",
    "In the Total Daily Activity vs Time Slept plot, users that had over 200 minutes of total daily activity tend to have more consistent sleep while Sedentary users in the Total Sleep vs Sedentary Time plot get significantly less sleep. The Total Sleep vs Very Active Users reinforces this finding.   \n",
    "\n",
    "The Calories vs Total Daily Activity plot shows a strong positive correlation with total daily activity vs calories consumed. \n",
    "\n",
    "## How can these findings help Bellabeat?\n",
    "The Bellabeat app can be improved to send users reminders to be active when it detects that they have been sedentary for a certain period of time. The app could aim to remind users to be active between a time frame in increments. For example, the user sets that their reminder hours are from 7am to 7pm. To achieve a total of at least 200 minutes of active time in a day, the Bellabeat app could remind the user to be active for 20 minutes every 2 hours. On top of implementing this, Bellabeat should also include a statistical dashboard for the user so they can view how their sleep is actually improving.   \n",
    "\n",
    "Bellabeat can also promote the Bellabeat Leaf with this analysis. The Fitbit users stopped wearing the Fitbit to sleep towards the end of the study. This may be because of the watch being uncomfortable while sleep. The metadata did not explicitly state why this trend is happening. The Bellabeat Leaf may be a more comfortable alternative to this. Giving users the choice to pick between a bracelet, necklace, or clip will drastically improve data collection.    \n",
    "\n",
    "The Bellabeat app can also implement a calorie tracking system. The data shows that there is a significant amount of users who are calorie deficient (consuming under 2000 calories in a day). This deficiency could also be a reason why the user is less inclined to be active. The calorie tracker in the app can also be display on the Bellabeat Spring, which is a water bottle that tracks daily water intake. \n",
    "\n",
    "\n",
    "\n",
    "# Limitations\n",
    "Upon an initial inspection of the data, I noticed the metadata did not state what measurement distance was. After some research in the Kaggle discussion board, I was led to fitabase.com where there is a PDF file of all the variable names, their data types, and a brief description which includes the unit of measurement.   \n",
    "\n",
    "The metadata on Kaggle stated there was 30 participants in the study. When I ran a distinct count of unique ID’s in the dataset, I found that there were 33 unique participants with valid data, and 24 of those participants participated in the sleep study. It appears that although the metadata was lacking, I was still able to complete an analysis and find the crucial metadata.   \n",
    "\n",
    "The dataset for Fitbit users is extremely small. According to statista.com and businessofapps.com, Fitbit had 23.2 million users’ in 2016. With 23.2 million users with a confidence level of 95% and a 5% margin of error, an ideal sample size is 385 participants. The data cannot be representative of the Fitbit user population but it can still offer interesting insights for Bellabeat’s marketing team.     \n",
    "\n",
    "The dataset does not include the sex of the user. This limits our ability to determine if a specific calorie deficit or a calorie surplus is present.\n"
   ]
